import React from 'react'

function Profil() {
  const nav = useNavigate();
  const { isAuth } = useSelector((state) => state.user);

  useEffect(() => {
    if (!isAuth) nav("/login");
  }, [isAuth, nav]);
  return (
    <div>Profil</div>
  )
}

export default Profil
